import React from "react"

import {
NavLink,
}
 from "react-router-dom";

function Group (){
return( 
	<div> 
 		<h2>Group name:</h2><h3>Anna's Graphic design classes</h3>

 		<div class="button"><NavLink to="/groupchannel">ACCESS GROUP CHANNEL</NavLink></div>

 		<img className="img-responsive" src={"../../assets/images/icon-user.png"} alt="user"/>
 		<div class="button"><NavLink to="/groupchannel"></NavLink></div>
 		<img className="img-responsive" src={"../../assets/images/icon-group.png"} alt="group"/>
 		<img className="img-responsive" src={"../../assets/images/icon-transfer.png"} alt="files transfer"/>
 		<img className="img-responsive" src={"../../assets/images/icon-network.png"} alt="my network"/>
  	</div>
  )
}


export default Group
